import { createRouter, createWebHistory } from "vue-router";
import HomeView from "../views/ProjectsView.vue";
import ContactView from "../views/ContactView.vue";
import GraduationView from "../views/GraduationView.vue";
import NetworkView from "../views/NetworkView.vue";
import PortifolioView from "../views/PortifolioView.vue";
import ProjectsView from "../views/ProjectsView.vue";
import SkillsViews from "../views/SkillsViews.vue";


const routes = [
  {
    path: "/",
    name: "home",
    component: HomeView,
  },
  {
    path: "/contact",
    name: "contact",
    component: ContactView,
  },
  {
    path: "/graduation",
    name: "graduation",
    component: GraduationView,
  },
  {
    path: "/network",
    name: "network",
    component: NetworkView,
  },
  {
    path: "/",
    name: "home",
    component: PortifolioView,
  },
  {
    path: "/",
    name: "home",
    component: HomeView,
  },
];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes,
});

export default router;
